class Analizador():
    def __init__(self):
        self.__model = None
        self.__load_model()

    def __load_model(self):

        """Load the model to self.__model once it's been trainned"""
        self.__model = joblib.load(os.path.dirname(__file__) + '\\training\\sentimientos_model.pkl')

    def analizar(self, mensaje):

        message_cv = CountVectorizer(vocabulary=vocabulary).transform([mensaje]).conjugate()
        sentimiento = self.__model.predict(message_cv)[0]
        
        if sentimiento == -1:
            return "NEGATIVO"
        elif sentimiento == 0:
            return "NEUTRO"
        elif sentimiento == 1:
            return "POSITIVO"
